const AllFacultyName = () => {
  var faculties = [
    {
      FacultyId: 1,
      FacultyName: "nirav bhat",
      FacultyDesignation: "dean-school of engineering",
      FacultyEducationQuilification: "phd",
      FacultyExperience: "10years",
      FacultyImage:
        "https://www.rku.ac.in/rkupanel/images/faculty-achievement/050822074428nirav.jpg",
    },
    {
      FacultyId: 2,
      FacultyName: "chetan",
      FacultyDesignation: "Hod-school of engineering",
      FacultyEducationQuilification: "phd",
      FacultyExperience: "8years",
      FacultyImage:
        "https://www.rku.ac.in/rkupanel/images/faculty-achievement/050822074428nirav.jpg",
    },
    {
      FacultyId: 3,
      FacultyName: "snehal sathwara",
      FacultyDesignation: "Hod-school of engineering",
      FacultyEducationQuilification: "phd",
      FacultyExperience: "11years",
      FacultyImage:
        "https://www.rku.ac.in/rkupanel/images/faculty-achievement/050822074428nirav.jpg",
    },
    {
      FacultyId: 4,
      FacultyName: "jai sir",
      FacultyDesignation: "professor-school of engineering",
      FacultyEducationQuilification: "phd",
      FacultyExperience: "8years",
      FacultyImage:
        "https://www.rku.ac.in/rkupanel/images/faculty-achievement/050822074428nirav.jpg",
    },
  ];

  const FormatedFac = faculties.map((fac) => {
    return (
      <>
        <div class="card" style="width: 18rem;">
          <img src={fac.FacultyImage} class="card-img-top" alt="..." />
          <div class="card-body">
            <h5 class="card-title">{fac.FacultyName}</h5>
            <p class="card-text">
              {fac.FacultyDesignation}
            </p>
            <a href="#" class="btn btn-primary">
                {fac.FacultyExperience}
            </a>
          </div>
        </div>
      </>
    );
  });

  return FormatedFac;
};

export default AllFacultyName;
